2. We create an instance of the `readline.Interface` by calling `readline.createInterface()`. We pass an object with two properties:
   - `input`: Specifies the readable stream to read input from. In this case, we use `process.stdin`, which represents the standard input stream.
   - `output`: Specifies the writable stream to write output to. In this case, we use `process.stdout`, which represents the standard output stream.

